import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import HomeView from "./views/home/HomeView";
import RealTest from "./views/admin/realTest";
import Writing from "./views/admin/writing";
import AppTest from "./views/admin/app";

function App() {
    return (
        <>
            <BrowserRouter>
                <Route exact path="/" component={HomeView}/>
                <Route path="/test" component={AppTest}/>
                <Route path='/write' component={Writing}/>
            </BrowserRouter>

        </>
  );
}

export default App;
